import "./footer.scss"

export default function Footer() {
  return (
    <div className="footer">

        <div className="container">
                
                <div className="left">
                    <img src="https://i.imgur.com/1jSBuVo.png" alt="" />
                    <span>Github Repository - GitHub.com/CineraM </span>
        
                </div>

                
        </div>

    </div>
  )
}
